import React from 'react'
import {Link} from 'react-router-dom'
import { useMeQuery, useLogoutMutation } from '../generated/graphql'
import { setAccessToken } from '../accessToken'
import {AppBar, Toolbar, IconButton, Grid, Button} from "@material-ui/core"

interface Props {

}

export const Header: React.FC<Props> = () => {
    const {data, loading} = useMeQuery({fetchPolicy: "network-only"})
    const [logout, {client}] = useLogoutMutation();

    let body: any = null;
    if(loading){
        body = null;
    } else if(data && data.me) {
        body = (<div> Du bist eingelogged als: {data.me.email} </div>);
    } else {
        body = (<div> Nicht eingelogged </div>);
    }

    return (


    <header> 
      <AppBar position="static">

        <Toolbar>
            <Grid
              justify="space-between" // Add it here :)
              container
            >
            <Grid item>
              <IconButton href="/" edge="start" color="inherit" aria-label="menu">
              Club Gr√ºn
              </IconButton>
            </Grid>

            <Grid item>
            <div>
              {!loading && data && data.me ? (<Button color="inherit" onClick={async () =>{
                    await logout();
                    setAccessToken("");
                    await client!.resetStore();
              }}>logout</Button>) :
              <div>
                <Button href="/login" color="inherit">Login</Button>
                <Button href="/register" color="inherit">Register</Button> 
                </div>}
            </div>

            </Grid>
        </Grid>
      </Toolbar>
      </AppBar> 
        <div>
          <Link to="/bye">bye</Link>
        </div>

        {body}
    </header>
        )
}
